// Vordefinierte Liste der gültigen Kategorien (case-sensitive)
const validCategories = [
  "Auftragsbestätigung",
  "Rechnung",
  "Storno",
  "Zahlungserinnerung",
  "Verspätete Lieferung",
  "General Query"
];

// Eingabedaten
const kandidatArray = $('Information Extractor').first().json.output.klassifizierung || $('Information Extractor1').first().json.output.klassifizierung || [];
const dataArray = $input.first().json['data [object Object]'] || [];

// Funktion, um zu prüfen, welche Kandidaten in validCategories und dataArray enthalten sind
function checkKandidatenInArray(kandidaten, data) {
  const result = {
    allValidAndIncluded: true,
    included: [], // Enthält Objekte mit name und id
    notIncluded: [],
    invalidCategories: [] // Enthält Kandidaten, die nicht in validCategories sind
  };

  kandidaten.forEach(kandidat => {
    // Prüfe, ob der Kandidat in validCategories enthalten ist (case-sensitive)
    if (!validCategories.includes(kandidat)) {
      result.invalidCategories.push(kandidat);
      result.allValidAndIncluded = false;
      return;
    }

    // Prüfe, ob der Kandidat im dataArray enthalten ist
    const foundItem = data.find(item => item.name === kandidat);
    if (foundItem) {
      result.included.push({
        name: foundItem.name,
        id: foundItem.id
      });
    } else {
      result.notIncluded.push(kandidat);
      result.allValidAndIncluded = false;
    }
  });

  return result;
}

// Ergebnis
const result = checkKandidatenInArray(kandidatArray, dataArray);

// Ausgabe
return {
  allValidAndIncluded: result.allValidAndIncluded,
  included: result.included,
  notIncluded: result.notIncluded,
  invalidCategories: result.invalidCategories,
  kandidatArray: kandidatArray
};

// Eingabedaten
const includedKandidaten = $('Switch').first().json.included || [];
const messageLabels = $input.first().json.labels || [];
const aggregateData = $('Aggregate').first().json["data [object Object]"] || [];

// Funktion, um zu prüfen, ob die Kandidaten in den Labels der Nachricht existieren
function checkKandidatenInLabels(kandidaten, labels) {
  const result = {
    allFound: true,
    found: [],
    notFound: []
  };
  kandidaten.forEach(kandidat => {
    const isFound = labels.some(label => label.name === kandidat.name);
    if (isFound) {
      result.found.push(kandidat);
    } else {
      result.notFound.push(kandidat);
      result.allFound = false;
    }
  });
  return result;
}

// Funktion, um die ID für einen Kandidaten aus dem Aggregate-Array zu finden
function findIdForKandidat(kandidat, aggregateData) {
  const foundEntry = aggregateData.find(entry => entry.name === kandidat.name);
  return foundEntry ? foundEntry.id : null;
}

// Ergebnis der Prüfung
const result = checkKandidatenInLabels(includedKandidaten, messageLabels);

// IDs für notFound-Kandidaten aus Aggregate hinzufügen
result.notFound.forEach(kandidat => {
  const id = findIdForKandidat(kandidat, aggregateData);
  if (id) {
    kandidat.id = id;
  }
});

// Ausgabe
return {
  allFound: result.allFound,
  found: result.found,
  notFound: result.notFound,
  inputLabels: messageLabels,
  inputKandidaten: includedKandidaten
};

